import {
    fetchCompForm,
    clearCompForm,
    makeOrderRequestAC,
} from './actions'

const makeOrderRequest = (data) => (dispatch) => {
    return dispatch(makeOrderRequestAC(data))
}

export {
    fetchCompForm,
    clearCompForm,
    makeOrderRequest
}
